import React,{Component} from 'react';
import{GoogleMap, withScriptjs,withGoogleMap} from 'react-google-maps';


class RideMap extends Component{
    render(){
        return(
            <div 
                style={{width:'80vw',
                        height:'80wh'
                        }}>
                <WrappedMap
                googleMapURL ={'https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyDo0sDqdV6VbGyyvSOMhO7rulT-y4c_ftg'}
                loadingElement ={<div style={{height:"80%"}} />}
                containerElement={<div style={{height:"80%"}} />}
                mapElement={<div style={{height:"80%"}} />}
                />
            </div>
        )
    }
}

function Map(){
    return(
        <GoogleMap  
        defaultZoom={12}
        defaultCenter={{lat:37.774929, lng:-122.419418}}/>
    );
} 

const WrappedMap =  withScriptjs(withGoogleMap(Map))

export default(RideMap)
